import { geoEqualEarth, geoPath } from 'd3';

export const Marks = ({ data }) => (
    <g className="map">
        {data.features.map(d => (
            <path
                className="map-plot" 
                d= {line()
                    .x(d => xScale(xValue(d)))
                    .y(d => yScale(yValue(d)))
                    .curve(curveNatural)(data)}
            />
        ))}
    </g>
);
